sources.styles\\blocks\\grid.scss:
.grid {
  display: grid;
  grid-template-columns: repeat(2, 1fr);
  column-gap: 20px;

  &--tablet {
    display: block;

    @include onTablet {
      display: grid;
    }
  }

  &--laptop {
    display: block;

    @include onLaptop {
      display: grid;
    }
  }

  &--desktop {
    display: block;

    @include onDesktop {
      display: grid;
    }
  }

  @include onTablet {
    grid-template-columns: repeat(6, 1fr);
  }

  @include onLaptop {
    grid-template-columns: repeat(12, 1fr);
  }

  &__item {
    @for $start from 1 through 12 {
      @for $end from $start through 12 {
        &--#{$start}-#{$end} {
          grid-column: #{$start} / #{$end + 1};
        }

        &--tablet-#{$start}-#{$end} {
          @include onTablet {
            grid-column: #{$start} / #{$end + 1};
          }
        }

        &--laptop-#{$start}-#{$end} {
          @include onLaptop {
            grid-column: #{$start} / #{$end + 1};
          }
        }

        &--desktop-#{$start}-#{$end} {
          @include onDesktop {
            grid-column: #{$start} / #{$end + 1};
          }
        }
      }
    }

    &--tablet-0 {
      display: none;

      @include onLaptop {
        display: block;
      }
    }

    &--mobile-0 {
      display: none;

      @include onTablet {
        display: block;
      }
    }
  }
}

sources.styles\\blocks\\page.scss:
.page {
  scroll-behavior: smooth;

  &__body {
    background-color: $colorBeige;

    @include onDesktop {
      background-color: #fff;
    }
  }

  &__menu {
    position: fixed;
    top: 0;
    right: 0;
    left: 0;
    z-index: 1;

    height: 100vh;

    transform: translateX(-100%);
    transition: transform 0.3s;

    &:target {
      transform: translateX(0);
    }
  }

  &__section {
    position: relative;
    margin-bottom: 60px;

    @include onTablet {
      margin-bottom: 100px;
    }

    @include onDesktop {
      margin-bottom: 200px;
    }
  }

  &__section-name {
    display: none;
    position: absolute;
    top: 0;
    width: max-content;

    font-family: "Sharp Sans Display No2", sans-serif;
    font-size: 14px;
    line-height: 18px;
    letter-spacing: 0.05em;
    text-transform: uppercase;
    text-align: right;

    color: rgba(52, 79, 16, 0.5);

    transform-origin: top left;
    transform: rotate(-90deg) translateX(-100%);

    &::after {
      content: "";
      position: absolute;
      top: 50%;
      right: calc(100% + 10px);
      display: block;
      width: 100px;
      height: 1px;

      background-color: rgba(52, 79, 16, 0.5);
    }

    @include onLaptop {
      display: block;
    }
  }

  &__title {
    margin-bottom: 12px;
    color: $colorGreen;
    letter-spacing: 0.05em;
    text-transform: uppercase;

    @include onTablet {
      font-weight: 500;
    }

    @include onLaptop {
      margin-bottom: 20px;
    }

    @include onDesktop {
      margin-bottom: 16px;
      line-height: 40px;
    }
  }
}

